import React, { FC } from 'react';
import { Header } from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD',
};


interface Props {
  children: React.ReactNode;
}

export const Layout: FC<Props> = props => (
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  );
